<h2>
<font color="#000000"><font size="22" style="font-size:22px;"><b>Obowiazek informacyjny w zwiazku z przetwarzaniem danych osobowych:</b></font></font></h2>
<p>
<font size="14" style="font-size:14px;">1. Administratorem Pani/Pana danych osobowych jest<br />
AIR SERVICE &bdquo;AS&rdquo; BOGUMIL WINNICKI PNEUMATYKA-KOMPRESORY-POLMO L&Oacute;DZ dalej: (&bdquo;ADMINISTRATOR&rdquo;), z siedziba: ul. Strykowska 177, 91-527 L&oacute;dz.&nbsp;Z Administratorem mozna sie kontaktowac pisemnie, za pomoca poczty tradycyjnej na adres: ul. Strykowska 177, 91-527 L&oacute;dz lub droga e-mailowa pod adresem: biuro@airservice.com.pl.</font><br/>
<p>
<font size="14" style="font-size:14px;">2. Pani/Pana dane osobowe sa przetwarzane na podstawie art. 6 ust. 1 lit. a i b dyrektywy Parlamentu Europejskiego i Rady (UE) 2016/680 z dnia 27 kwietnia 2016 r. w sprawie ochrony os&oacute;b fizycznych w zwiazku z przetwarzaniem danych osobowych przez wlasciwe organy do cel&oacute;w zapobiegania przestepczosci, prowadzenia postepowan przygotowawczych, wykrywania i scigania czyn&oacute;w zabronionych i wykonywania kar, w sprawie swobodnego przeplywu takich danych oraz uchylajaca decyzje ramowa Rady 2008/977/WSiSW, tj. w oparciu o zgode osoby, kt&oacute;rej dane dotycza.</font><br/>
<p>
<font size="14" style="font-size:14px;">3. Przetwarzanie odbywa sie w celu realizacji transakcji sprzedazowych, wysylania ofert sprzedazowych i ofert uslug np. serwisowych sprzetu pneumatycznego.</font><br/>
<p>
<font size="14" style="font-size:14px;">4. Dane osobowe nie pochodza od stron trzecich.</font><br/>
<p>
<font size="14" style="font-size:14px;">5. Administrator nie zamierza przekazywac danych do panstwa trzeciego lub organizacji miedzynarodowej.</font><br/>
<p>
<font size="14" style="font-size:14px;">6. Administrator bedzie przekazywal dane osobowe innym podmiotom, tylko na podstawie przepis&oacute;w prawa lub umowy powierzenia przetwarzania danych.</font><br/>
<p>
<font size="14" style="font-size:14px;">7. Dane osobowe beda przetwarzane przez Administratora do 5 lat od zakonczenia wsp&oacute;lpracy, sprzedaz, wykonania uslugi.</font><br/>
<p>
<font size="14" style="font-size:14px;">8. Osoba, kt&oacute;rej dane dotycza ma prawo do zadania od administratora dostepu do danych osobowych, ich sprostowania, usuniecia lub ograniczenia przetwarzania oraz o prawo do wniesienia sprzeciwu wobec przetwarzania, a takze prawo do przenoszenia danych.</font><br/>
<p>
<font size="14" style="font-size:14px;">9. Skarge na dzialania Administratora mozna wniesc do Prezesa Urzedu Ochrony Danych Osobowych.</font><br/>
<p>
<font size="14" style="font-size:14px;">10. Podanie danych osobowych jest dobrowolne, ale jego nie podanie powoduje brak mozliwosci wsp&oacute;lpracy, wykonania uslugi sprzedazowe czy serwisowej przez Administratora.</font><br/>
<p>
<font size="14" style="font-size:14px;">11. Administrator nie przewiduje zautomatyzowanego podejmowania decyzji.</font><br />
&nbsp;<br/>
<h3>
<font color="#FFFFFF"><font style="background-color:#0099ff;">&nbsp; Drogi uzytkowniku. Przez dalsze aktywne korzystanie z serwisu wyrazasz zgode na powyzsze postanowienia.&nbsp;&nbsp;</font></font></h3>
